import React from 'react';
import Icon from './Icon';

const RightSideHeader = () => {
    return (
        <div className="upper-right">
            <Icon 
                className="fab fa-facebook-f"
            />

            <Icon 
                className="fab fa-twitter"
            />

            <Icon 
                className="fab fa-youtube"
            />
        </div>
    );
}

export default RightSideHeader;
